import React from 'react';
import { useForm, ValidationError } from '@formspree/react';

function ContactForm() {
    const [state, handleSubmit] = useForm("xblrvvka");

    if (state.succeeded) {
        return <p>Thanks for joining!</p>;
    }

    return (
        <form 
            action="https://formspree.io/f/xblrvvka" // Set action attribute
            method="POST" // Set method to POST
            onSubmit={handleSubmit}
        >
            <label htmlFor="email">Email Address</label>
            <input
                id="email"
                type="email" 
                name="email" // Ensure name attribute is present
                required // Make the field required
            />
            <ValidationError 
                prefix="Email" 
                field="email"
                errors={state.errors}
            />
            <textarea
                id="message"
                name="message" // Ensure name attribute is present
                required // Make the field required
            />
            <ValidationError 
                prefix="Message" 
                field="message"
                errors={state.errors}
            />
            <button type="submit" disabled={state.submitting}>
                Submit
            </button>
        </form>
    );
}

export default ContactForm; // No parentheses here
